Rhonda-Rhonda-Bo-Bond-Da!!  Welcome back chickie.  You are a very patient
woman!  I would&#39;ve gone stir crazy without inet for that long.  Anyway glad
to have you back online!

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Rhonda W
Sent: Thursday, August 21, 2008 11:39 AM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Did ya miss me!?




Im bacccccccck!



Sorry had dead modem and had to wait for cable company to bring out a new
one, took em 3 weeks!



So I did a some sessions while I waited, got some good responses and
actually a few EVPs saying my name and that mom loves you....checked my mail
when I got my net back and got an email from the lady(Pat) that lived next
door to my mom and whom was a good friend of my mom.  Theres a new family
living on my moms property now, new mobile home and all...well they have a 3
year old son who talked to my moms friend a week or so ago...the little boy
was telling her about talking to a &quot;man with ugly eyes&quot; in his room and how
he was nice, he wasnt mean, Pat thinks(and I tend to agree) that the boy was
talking to my mom...my mom had realllllly short hair and didnt have pretty
eyes, she had almost manly features as she got older and it would be easy
for a 3 year old to think she was male, specially at night in a semi dark
room.  The boy didnt say what they talked about, but they had a conversation
and he wasnt scared...this happened on the day I got the EVPs in my session.
I wanna get a digi recorder now and see if they would allow me to do a
session at their place...would be very interesting to see what kind of
responses Id get if I were on her property compared to sitting in my place
which is 20 miles or so away.



Anyways, just wanted to share that with ya&#39;ll.  Hope everyone is having a
good week so far!  



Rhonda






